import{_ as e,o as a,c as n,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 33.2-1507  Reporting requirement.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1507.md","filePath":"vacode/33.2-1507.md"}'),r={name:"vacode/33.2-1507.md"},i=t('<h1 id="§-33-2-1507-reporting-requirement" tabindex="-1">§ 33.2-1507 Reporting requirement. <a class="header-anchor" href="#§-33-2-1507-reporting-requirement" aria-label="Permalink to &quot;§ 33.2-1507  Reporting requirement.&quot;">​</a></h1><p>A. No loan or other financial assistance shall be awarded from the Bank until the Secretary has provided copies of the management agreement and related criteria and guidelines to the Chairmen of the House Committees on Appropriations, Finance, and Transportation and the Senate Committees on Finance and Appropriations and on Transportation.</p><p>B. Within 30 days after each six-month period ending June 30 and December 31, the manager shall provide a report to the Chairmen of the House Committees on Appropriations, Finance, and Transportation and the Senate Committees on Finance and Appropriations and on Transportation, which shall include the amounts of loans and other financial assistance provided by the Bank and the projects for which the loans and other financial assistance were provided.</p><p>2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0868" target="_blank" rel="noreferrer">868</a>, § 33.1-23.13; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',4),o=[i];function s(p,c,d,h,l,m){return a(),n("div",null,o)}const g=e(r,[["render",s]]);export{f as __pageData,g as default};
